INSERT INTO `tb_activity` (`id`, `project_id`, `name`, `date_start`, `date_end`, `description`, `qty`, `time_start`, `time_end`) VALUES
(1, 1, 'กิจกรรมที่ : พัฒนาสถานศึกษาให้เป็นพื้นที่สร้างสรรค์ในชุมชนด้วยหนังสือภาพ หนังสือนิทานวรรณกรรมและของเล่นสำหรับเด็กปฐมวัยในพื้นที่ชายแดนใต้ ครั้งที่ 1', '2018-05-31', '2018-05-31', 'ลงนามความร่วมมือ MOU ', '50', '08:30:00', '16:00:15'),
(2, 2, 'กิจกรรมที่ 1 : พัฒนาศักยภาพครูในพื้นที่ชายแดนใต้ในเรื่องการผลิตสื่อเพื่อส่งเสริมการอ่านออกเขียนได้', '2018-05-28', '2018-05-29', 'อบรม 3D', '50', '00:00:00', '00:00:00'),
(3, 1, 'กิจกรรมที่ 2.2 : พัฒนาครูสอนไม่ตรงสาย', '2018-04-24', '2018-04-26', 'อบรมครูไม่ตรงสายครั้งที่ 1', '', '00:00:00', '00:00:00'),
(4, 1, 'กิจกรรมที่ : อบรมวิเคราะห์โจทย์ O-Net และ NT', '2018-05-10', '2018-05-11', '', '', '00:00:00', '00:00:00'),
(5, 1, 'กิจกรรมที่ : อบรมทำเนียบครูต้นแบบและนวัตกรรมต้นแบบ', '2018-05-12', '2018-05-13', '', '', '00:00:00', '00:00:00'),
(6, 1, 'กิจกรรมที่ : พัฒนาสถานศึกษาให้เป็นพื้นที่สร้างสรรค์ในชุมชนด้วยหนังสือภาพ หนังสือนิทานวรรณกรรมและของเล่นสำหรับเด็กปฐมวัยในพื้นที่ชายแดนใต้ ครั้งที่ 2', '2017-11-30', '2017-11-30', '', '', '00:00:00', '00:00:00'),
(7, 3, 'กิจกรรมที่ : การแนะแนวการศึกษาสู่อาชีพเพื่อพัฒนาผู้เรียนในยุค Thailand 4.0 ในพื้นที่ชายแดนภาคใต้', '2018-08-09', '2018-08-09', 'ครูพี่เลี้ยง', '', '00:00:00', '00:00:00'),
